import { Spinner } from "react-bootstrap"

const Animation = () => {
  return (
    <Spinner
    animation='grow'
    role='text'
    style={{
        width: '100px',
        height: '100px',
        margin: 'auto',
        display: 'block',
    }}></Spinner>
  )
}

export default Animation
